import React from 'react'

const AdminLogin = () => {
    return (
        <div className="admin_login_container" >
            <div class="bg-image"></div>

            <div class="bg-text">
            <h1>I am John Doe</h1>
            <p>And I'm a Photographer</p>
            </div> 
            
        </div>
    )
}

export default AdminLogin
